#include <iostream>
#include <string>
#include <vector>

using namespace std;

#include <iostream>
#include <string>

int main ()
{
std::string str ("");

vector<string> LetterCombinations {"Aa","aA", "Bb", "bB", "cC", "Cc", "Dd", "dD", "Ee", "eE",
"Ff", "fF", "Gg", "gG", "Hh", "hH",
"Ii", "iI", "Jj", "jJ", "Kk", "kK", "Ll", "lL", "Mm", "mM", "Nn", "nN", "Oo", "oO",
"Pp", "pP", "Qq", "qQ", "Rr", "rR", "Ss", "sS",
"Tt", "tT", "Uu", "uU", "Vv", "vV", "Ww", "wW", "Xx", "xX", "Yy", "yY", "Zz", "zZ"};

for(int i = 0; i < 1000; ++i){
for(auto a : LetterCombinations){
std::size_t foundIndex = str.find(a);
if (foundIndex != str.npos)
str.replace(foundIndex, a.size(), "");
}
}
std::cout << "Part one:" << str.length() << "\n";

return 0;
}
